import React from 'react';
import Navbar from './Navbar';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <header className="App-header" id="home">
        <h1>Welcome to [Your Company]</h1>
        <p>We are committed to providing the best services to our customers.</p>
      </header>
      <main>
        <section className="company-overview" id="about">
          <h2>About Us</h2>
          <p>Jiffy.ai is a leading provider of innovative solutions...</p>
        </section>
        <section className="services" id="services">
          <h2>Our Services</h2>
          <p>We offer a wide range of services including...</p>
        </section>
        <section className="contact" id="contact">
          <h2>Contact Us</h2>
          <p>Feel free to reach out to us at contact@yourcompany.com</p>
        </section>
      </main>
    </div>
  );
}

export default App;
